import React from 'react'
import './Footer.css'
export default class Footer extends React.Component {
  constructor(props) {
    super(props);

  }



  render() {
	  return (
	  <div >
	  <ul className='footbar'>
      <li><p><img src={require("./imgs/logo1.png")} alt=""/></p>
	  <p>首页</p></li>
      <li><p className='iconfont icon-sousuo'></p><p>发现</p></li>
      <li><p className='iconfont icon-sousuo'></p><p>订单</p></li>
      <li><p className='iconfont icon-sousuo'></p><p>我的</p></li>
    </ul>
	  </div>
	  )
  }
}
